import React from 'react';
import { UISref, UIRouter, UIView, pushStateLocationPlugin, servicesPlugin, UIRouterReact} from "@uirouter/react";


//OnsenUI
var Ons = require('onsenui');
var ROns = require('react-onsenui');

export default class extends React.Component {
    constructor(){
        super();

        this.state = {

        }
    }

    
    render() {
      return (
        <ROns.Page>
          <ROns.Toolbar style={{'position': 'relative'}}>
            <div className="center"> авторизация </div>
          </ROns.Toolbar>
          <form className="form-signin">
                <h2 className="form-signin-heading"> Please sign in </h2>
                <label for="inputEmail" className="sr-only"> Email address
                </label>
                <input type="email" id="inputEmail" className="form-control" placeholder="Email address" required autofocus />
                <label for="inputPassword" className="sr-only"> Password</label>
                <input type="password" id="inputPassword" className="form-control" placeholder="Password" required />
                <button className="btn btn-lg btn-primary btn-block" type="button"> Sign in
                </button>
                <div>
                    <UISref to="app.account.signUp"><a>SingUp</a></UISref>
                </div>
            </form>
        </ROns.Page>
      );
    }
}
